css:
@font-face {
  font-family: 'Octicons Regular';
  src: url("octicons.woff") format("woff");
  font-weight: normal;
  font-style: normal;
}
html,
body {
  width: 100%;
  height: 100%;
  overflow: hidden;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
  font-size: 13px;
}
h1,
h2,
h3,
h4,
h5,
h6 {
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
}
.workspace {
  height: 100%;
  overflow: hidden;
  position: relative;
  background-color: #cccccc;
  font-family: 'Lucida Grande', 'Segoe UI', sans-serif;
}
.workspace .horizontal {
  display: -webkit-flex;
  height: 100%;
}
.workspace .vertical {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-flow: column;
}
